INSERT INTO `cms_article` VALUES ('1', '3', '二手住宅买卖 税费要算清', '', 'green', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/14847880157559.jpg', '', '在北京买二手住宅，一定要足额交税。但是由于每一套二手住宅取得房产证的年限不同，所以在出售时需要交税数额也有所不同。为了帮助大家搞清楚买二手住宅交多少税，我们邀请业内专家来算一算账。', '0', null, '11', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 08:52:00', null, '0', '1');
INSERT INTO `cms_article` VALUES ('10', '4', '特斯拉致死车祸有了调查结果：不是自动驾驶的错', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/8b067429ad1e8a9ee09ea280607f4149.jpg', '人工智能 自动驾驶', '网易科技讯1月20日消息 美国国家公路交通安全管理局（NHTSA）周四表示，没有证据表明5月份发生在佛罗里达的致死特斯拉事故是由自动驾驶系统所致。此一&ldquo;无罪判决&rdquo;为自动驾驶技术发展免除了潜在阻碍。', '10', null, '19', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:35:40', null, '0', '2');
