INSERT INTO `cms_article` VALUES ('21', '8', '谷歌也有自己的智能手表了？下月发布，LG代工', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/cdeeebfeaec94b47a1de58872035cb6b20170120080451.jpeg', '智能手表 Google', '网易科技讯 1月20日消息，据英国媒体报道，谷歌将通过自己的智能手表挑战苹果的Apple Watch，该产品由LG生产，准备在2月9日发布，运行的是谷歌最新系统Android Wear 2.0。谷歌和LG预计在2月9日的特别活动上推出3个版本的智能手表，随后在第二天在美国上市，在今年晚些时候在世界其他地方上市，很可能在2月27日巴塞罗那世界移动大会（MWC）后。', '0', null, '11', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:32:21', null, '0', '0');
INSERT INTO `cms_article` VALUES ('22', '28', '刘德华专心休息谢绝朋友探访 朱丽倩通宵留院照顾', '', 'red', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/s_CB42MVSR00AJ0003.jpg', '关键字1,关键字2', '网易娱乐1月20日报道 北京时间1月20日消息，据香港媒体报导，在泰国拍广告堕马受伤的刘德华昨天（1月19日）凌晨乘医疗专机返回香港接受治疗。他被送入养和医院时是固定在担架床上，脸上的眉心位置伤痕明显但神情清醒。经医生检验后，据消息称华仔的伤势还不算严重，不用开刀做手术，但未来几个月他要卧床休息，让骨折位置自然愈合，并且要做物理治疗。导演杜琪峰已联系刘德华并慰问了他，说刘德华的情况&ldquo;无大碍，不是咁', '0', null, '2', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:23:04', null, '0', '0');
INSERT INTO `cms_article` VALUES ('23', '28', '佟丽娅再谈陈思诚&ldquo;出轨门&rdquo;：别太关注我家事', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/3eba1ba87c9c110fef333c9963625399.jpg', '关键字1,关键字2', '网易娱乐1月20日报道，陈思诚被曝深夜与两名女子共处一室，并一夜未出酒店，随后，陈思诚出轨事件不断发酵，消息一出，迅速引起网友关注。1月16日佟丽娅发布朋友圈，只有简单的一句话：&ldquo;重新开始，丫丫加油。&rdquo;1月19日晚，在《真正男子汉》最后一期播出一小时前，佟丽娅现身湖南卫视媒体采访群给大家大派红包，佟丽娅心情比较轻松：&ldquo;麻烦大家发发正能量 别太关注我家事哈&rdquo;，并配以&ldquo;偷笑&rdquo;的表情。面对大家纷纷表达的', '0', null, '5', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:21:20', null, '0', '0');
