INSERT INTO `cms_article` VALUES ('3', '3', '楼市一旦崩盘 买这13种房子的人将彻底悲剧！', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/65721484707278.jpg', 'WWW', '听闻这些消息，一些高价接盘的购房者，特别是投资类购房者，纷纷开始担心是不是真的会崩盘。\r\n不论楼市如何走向，总有一部分房子房价依然坚挺，而有些房子则注定难升值！并且房价泡沫产生，楼市一旦崩盘，买了以下13种房子的人真的彻底悲剧了！买套升值房，再也不会有楼市会崩盘的的担忧了。', '0', null, '4', ',2,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 08:48:51', null, '0', '0');
