INSERT INTO `cms_article` VALUES ('4', '3', '春节前&ldquo;菜篮子&rdquo;价格呈现季节性上涨 节后将回落', '', 'green', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/14847101318742.jpg', '', '距离春节假期越来越近，筹划年夜饭的人们也开始密切关注&ldquo;菜篮子&rdquo;走势。&ldquo;预计春节前主要&lsquo;菜篮子&rsquo;产品价格将会继续季节性上涨，春节后将季节性回落&rdquo;，农业部市场与经济信息司司长唐珂在17日举行的新闻发布会上表示，在供给总量相对宽松的大背景下，2017年我国农产品市场运行有望保持基本稳定。', '0', null, '26', ',1,2,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 08:45:32', null, '0', '0');
