INSERT INTO `cms_article` VALUES ('5', '3', '关注医生收入：挂号费还不如理发花费高', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/14847077129947.jpg', 'qqqqqqqqqqqq', '习近平总书记在全国卫生与健康大会上强调，要着力发挥广大医务人员积极性，从提升薪酬待遇、发展空间、执业环境、社会地位等方面入手，关心爱护医务人员身心健康，通过多种形式增强医务人员职业荣誉感，营造全社会尊医重卫的良好风气。', '0', null, '8', ',2,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 08:47:16', null, '0', '0');
