INSERT INTO `cms_article` VALUES ('6', '3', '每15天至少维保一次 你们小区电梯维保达标了吗', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/00300328781_fefa83ec.jpg', '电梯 保养', '中安在线讯  据安徽商报报道  &ldquo;电梯是不存在报废年限的，但必须做好保养。&rdquo;随着高层建筑的日益增多，我们的生活、工作、出行越来越离不开电梯，偶而也会遭遇各类电梯事故。安徽省质监局最新统计显示，截至2016年底，合肥在册电梯总数5.2万台，占全省三分之一强。', '999', null, '128', ',2,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:35:18', null, '0', '0');
INSERT INTO `cms_article` VALUES ('7', '4', '为什么人工智能助手更像人工智障？真相了', '', '', '/jeesite/userfiles/1/_thumbs/images/cms/article/2017/01/561fc6ffa9a19fcadd13cbce9c8ec7b1.jpg', '人工智能', '&ldquo;我不是针对谁，只是在座现在所有做C端智能助理的都是坑。&rdquo;\r\n\r\n在确定这个话题之前，有必要先对群嘲做个限定：\r\n\r\n现在：在&ldquo;API困境&rdquo;被解决之前（后详）。', '0', null, '0', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2017-01-20 09:17:33', null, '0', '0');
